import React from "react";
import { NavigationContainer } from "@react-navigation/native";
import { createStackNavigator } from "@react-navigation/stack";
import Mainpage from "../views/Mainpage";
import { Homepage } from "../views/Homepage";
import { createMaterialTopTabNavigator } from '@react-navigation/material-top-tabs';
import {Certificates } from "../views/Certificates"

const Stack = createStackNavigator();

const Tab = createMaterialTopTabNavigator();


function MyTabs() {
  return (


          <Tab.Navigator tabBarOptions={{style: { backgroundColor: 'powderblue' }}}>
              <Tab.Screen name="Mainpage" component={Mainpage} />
              <Tab.Screen name="Settings" component={Mainpage} />
          </Tab.Navigator>


  );
}


// export default MyTabs;


function StackVerify() {
  return (
    <Stack.Navigator>
      <Stack.Screen name="Home" component={Homepage} />
      <Stack.Screen name="Notifications" component={Mainpage} />

    </Stack.Navigator>
  );
}


const { Navigator, Screen } = createStackNavigator();

 const HomeNavigator = () => (
  <Navigator headerMode="none">
    <Screen name="Homepage" component={Homepage}></Screen>
    <Screen name="Mainpage" component={MyTabs} />


  </Navigator>
);

export const HomeNavigate = () => (
   <NavigationContainer>
    <HomeNavigator />
  </NavigationContainer>
);
